function GetAnalysisData(){return Analysis.data}var Analysis={data:[{id:"1",scripture:"1 Corinthians\\10:32-33",analysis:"Positive Mental Qualities",title:"Agreeableness",verses:"{I}{B}WEB\\1 Corinthians\\10:32-33{/I}{/B}{BR}{BR}32  Give no occasions for stumbling, either to Jews, or to Greeks, or to the assembly of God;\r {BR}33  even as I also please all men in all things, not seeking my own profit, but the profit of the many, that they may be saved.\r {BR}{BR}"},{id:"2",scripture:"Philippians\\3:13-14",analysis:"Positive Mental Qualities",title:"Ambition",verses:"{I}{B}WEB\\Philippians\\3:13-14{/I}{/B}{BR}{BR}13  Brothers, I don't regard myself as yet having taken hold, but one thing I do. Forgetting the things which are behind, and stretching forward to the things which are before,\r {BR}14  I press on toward the goal for the prize of the high calling of God in Christ Jesus.\r {BR}{BR}"},{id:"3",scripture:"2 Timothy\\2:15",analysis:"Positive Mental Qualities",title:"Analysis",verses:"{I}{B}WEB\\2 Timothy\\2:15{/I}{/B}{BR}{BR}15  Give diligence to present yourself approved by God, a workman who doesn't need to be ashamed, properly handling the Word of Truth.\r {BR}{BR}"},{id:"4",scripture:"Psalms\\27:4",analysis:"Positive Mental Qualities",title:"Beauty ",verses:"{I}{B}WEB\\Psalms\\27:4{/I}{/B}{BR}{BR}4  One thing I have asked of Yahweh, that I will seek after, that I may dwell in the house of Yahweh all the days of my life, to see Yahweh's beauty, and to inquire in his temple.\r {BR}{BR}"},{id:"5",scripture:"1 Corinthians\\13:1",analysis:"Positive Mental Qualities",title:"Charity",verses:"{I}{B}WEB\\1 Corinthians\\13:1{/I}{/B}{BR}{BR}1  If I speak with the languages of men and of angels, but don't have love, I have become sounding brass, or a clanging cymbal.\r {BR}{BR}"},{id:"6",scripture:"Proverbs\\15:13",analysis:"Positive Mental Qualities",title:"Cheerfulness",verses:"{I}{B}WEB\\Proverbs\\15:13{/I}{/B}{BR}{BR}13  A glad heart makes a cheerful face; but an aching heart breaks the spirit.\r {BR}{BR}"},{id:"7",scripture:"Philippians\\3:13",analysis:"Positive Mental Qualities",title:"Concentration",verses:"{I}{B}WEB\\Philippians\\3:13{/I}{/B}{BR}{BR}13  Brothers, I don't regard myself as yet having taken hold, but one thing I do. Forgetting the things which are behind, and stretching forward to the things which are before,\r {BR}{BR}"},{id:"8",scripture:"Hebrews\\10:35",analysis:"Positive Mental Qualities",title:"Confidence",verses:"{I}{B}WEB\\Hebrews\\10:35{/I}{/B}{BR}{BR}35  Therefore don't throw away your boldness, which has a great reward.\r {BR}{BR}"},{id:"9",scripture:"1 Timothy\\6:6",analysis:"Positive Mental Qualities",title:"Contentment",verses:"{I}{B}WEB\\1 Timothy\\6:6{/I}{/B}{BR}{BR}6  But godliness with contentment is great gain.\r {BR}{BR}"},{id:"10",scripture:"Joshua\\1:7",analysis:"Positive Mental Qualities",title:"Courage",verses:"{I}{B}WEB\\Joshua\\1:7{/I}{/B}{BR}{BR}7  Only be strong and very courageous, to observe to do according to all the law, which Moses my servant commanded you. Don't turn from it to the right hand or to the left, that you may have good success wherever you go.\r {BR}{BR}"},{id:"11",scripture:"1 Corinthians\\13:5",analysis:"Positive Mental Qualities",title:"Courtesy",verses:"{I}{B}WEB\\1 Corinthians\\13:5{/I}{/B}{BR}{BR}5  doesn't behave itself inappropriately, doesn't seek its own way, is not provoked, takes no account of evil;\r {BR}{BR}"},{id:"12",scripture:"Joshua\\24:15",analysis:"Positive Mental Qualities",title:"Decision",verses:"{I}{B}WEB\\Joshua\\24:15{/I}{/B}{BR}{BR}15  If it seems evil to you to serve Yahweh, choose this day whom you will serve; whether the gods which your fathers served that were beyond the River, or the gods of the Amorites, in whose land you dwell: but as for me and my house, we will serve Yahweh.\r {BR}{BR}"},{id:"13",scripture:"2 Corinthians\\12:16",analysis:"Positive Mental Qualities",title:"Diplomacy",verses:"{I}{B}WEB\\2 Corinthians\\12:16{/I}{/B}{BR}{BR}16  But be it so, I did not myself burden you. But, being crafty, I caught you with deception.\r {BR}{BR}"},{id:"14",scripture:"1 Kings\\3:9",analysis:"Positive Mental Qualities",title:"Discernment",verses:"{I}{B}WEB\\1 Kings\\3:9{/I}{/B}{BR}{BR}9  Give your servant therefore an understanding heart to judge your people, that I may discern between good and evil; for who is able to judge this your great people?\r {BR}{BR}"},{id:"15",scripture:"Proverbs\\2:11",analysis:"Positive Mental Qualities",title:"Discretion",verses:"{I}{B}WEB\\Proverbs\\2:11{/I}{/B}{BR}{BR}11  Discretion will watch over you. Understanding will keep you,\r {BR}{BR}"},{id:"16",scripture:"1 Samuel\\30:6",analysis:"Positive Mental Qualities",title:"Encouragement",verses:"{I}{B}WEB\\1 Samuel\\30:6{/I}{/B}{BR}{BR}6  David was greatly distressed; for the people spoke of stoning him, because the soul of all the people was grieved, every man for his sons and for his daughters: but David strengthened himself in Yahweh his God.\r {BR}{BR}"},{id:"17",scripture:"Psalms\\18:28",analysis:"Positive Mental Qualities",title:"Enlightenment",verses:"{I}{B}WEB\\Psalms\\18:28{/I}{/B}{BR}{BR}28  For you will light my lamp, Yahweh. My God will light up my darkness.\r {BR}{BR}"},{id:"18",scripture:"1 Corinthians\\15:10",analysis:"Positive Mental Qualities",title:"Enthusiasm",verses:"{I}{B}WEB\\1 Corinthians\\15:10{/I}{/B}{BR}{BR}10  But by the grace of God I am what I am. His grace which was bestowed on me was not futile, but I worked more than all of them; yet not I, but the grace of God which was with me.\r {BR}{BR}"},{id:"19",scripture:"Romans\\12:3",analysis:"Positive Mental Qualities",title:"Fairmmdedness",verses:"{I}{B}WEB\\Romans\\12:3{/I}{/B}{BR}{BR}3  For I say, through the grace that was given me, to every man who is among you, not to think of himself more highly than he ought to think; but to think reasonably, as God has apportioned to each person a measure of faith.\r {BR}{BR}"},{id:"20",scripture:"Proverbs\\6:8",analysis:"Positive Mental Qualities",title:"Forethought",verses:"{I}{B}WEB\\Proverbs\\6:8{/I}{/B}{BR}{BR}8  provides her bread in the summer, and gathers her food in the harvest.\r {BR}{BR}"},{id:"21",scripture:"Genesis\\41:35-36",analysis:"Positive Mental Qualities",title:"Frugality",verses:"{I}{B}WEB\\Genesis\\41:35-36{/I}{/B}{BR}{BR}35  Let them gather all the food of these good years that come, and lay up grain under the hand of Pharaoh for food in the cities, and let them keep it.\r {BR}36  The food will be for a store to the land against the seven years of famine, which will be in the land of Egypt; that the land not perish through the famine.\r {BR}{BR}"},{id:"22",scripture:"Luke\\6:23",analysis:"Positive Mental Qualities",title:"Happiness",verses:"{I}{B}WEB\\Luke\\6:23{/I}{/B}{BR}{BR}23  {I}{B}Rejoice in that day, and leap for joy, for behold, your reward is great in heaven, for their fathers did the same thing to the prophets.{/B}{/I}\r {BR}{BR}"},{id:"23",scripture:"Romans\\12:17",analysis:"Positive Mental Qualities",title:"Honesty",verses:"{I}{B}WEB\\Romans\\12:17{/I}{/B}{BR}{BR}17  Repay no one evil for evil. Respect what is honorable in the sight of all men.\r {BR}{BR}"},{id:"24",scripture:"Romans\\2:10",analysis:"Positive Mental Qualities",title:"Honor",verses:"{I}{B}WEB\\Romans\\2:10{/I}{/B}{BR}{BR}10  But glory, honor, and peace go to every man who works good, to the Jew first, and also to the Greek.\r {BR}{BR}"},{id:"25",scripture:"Romans\\5:5",analysis:"Positive Mental Qualities",title:"Hope",verses:"{I}{B}WEB\\Romans\\5:5{/I}{/B}{BR}{BR}5  and hope doesn't disappoint us, because God's love has been poured out into our hearts through the Holy Spirit who was given to us.\r {BR}{BR}"},{id:"26",scripture:"2 Timothy\\4:2",analysis:"Positive Mental Qualities",title:"Initiative",verses:"{I}{B}WEB\\2 Timothy\\4:2{/I}{/B}{BR}{BR}2  preach the word; be urgent in season and out of season; reprove, rebuke, and exhort, with all patience and teaching.\r {BR}{BR}"},{id:"27",scripture:"John\\8:32",analysis:"Positive Mental Qualities",title:"Intuition",verses:"{I}{B}WEB\\John\\8:32{/I}{/B}{BR}{BR}32  {I}{B}You will know the truth, and the truth will make you free.{/B}{/I}\r {BR}{BR}"},{id:"28",scripture:"Philippians\\3:3",analysis:"Positive Mental Qualities",title:"Joy",verses:"{I}{B}WEB\\Philippians\\3:3{/I}{/B}{BR}{BR}3  For we are the circumcision, who worship God in the Spirit, and rejoice in Christ Jesus, and have no confidence in the flesh;\r {BR}{BR}"},{id:"29",scripture:"Psalms\\119:66",analysis:"Positive Mental Qualities",title:"Judgment",verses:"{I}{B}WEB\\Psalms\\119:66{/I}{/B}{BR}{BR}66  Teach me good judgment and knowledge, for I believe in your commandments.\r {BR}{BR}"},{id:"30",scripture:"Deuteronomy\\10:20",analysis:"Positive Mental Qualities",title:"Justice",verses:"{I}{B}WEB\\Deuteronomy\\10:20{/I}{/B}{BR}{BR}20  You shall fear Yahweh your God; you shall serve him; and you shall cling to him, and you shall swear by his name.\r {BR}{BR}"},{id:"31",scripture:"Romans\\12:10",analysis:"Positive Mental Qualities",title:"Kindness",verses:"{I}{B}WEB\\Romans\\12:10{/I}{/B}{BR}{BR}10  In love of the brothers be tenderly affectionate one to another; in honor preferring one another;\r {BR}{BR}"},{id:"32",scripture:"Colossians\\1:10",analysis:"Positive Mental Qualities",title:"Knowledge",verses:"{I}{B}WEB\\Colossians\\1:10{/I}{/B}{BR}{BR}10  that you may walk worthily of the Lord, to please him in all respects, bearing fruit in every good work, and increasing in the knowledge of God;\r {BR}{BR}"},{id:"33",scripture:"Proverbs\\11:25",analysis:"Positive Mental Qualities",title:"Liberality",verses:"{I}{B}WEB\\Proverbs\\11:25{/I}{/B}{BR}{BR}25  The liberal soul shall be made fat. He who waters shall be watered also himself.\r {BR}{BR}"},{id:"34",scripture:"1 John\\4:18",analysis:"Positive Mental Qualities",title:"Love",verses:"{I}{B}WEB\\1 John\\4:18{/I}{/B}{BR}{BR}18  There is no fear in love; but perfect love casts out fear, because fear has punishment. He who fears is not made perfect in love.\r {BR}{BR}"},{id:"35",scripture:"Proverbs\\28:20",analysis:"Positive Mental Qualities",title:"Loyalty",verses:"{I}{B}WEB\\Proverbs\\28:20{/I}{/B}{BR}{BR}20  A faithful man is rich with blessings; but one who is eager to be rich will not go unpunished.\r {BR}{BR}"},{id:"36",scripture:"Ephesians\\4:1",analysis:"Positive Mental Qualities",title:"Morality",verses:"{I}{B}WEB\\Ephesians\\4:1{/I}{/B}{BR}{BR}1  I therefore, the prisoner in the Lord, beg you to walk worthily of the calling with which you were called,\r {BR}{BR}"},{id:"37",scripture:"Hebrews\\5:8",analysis:"Positive Mental Qualities",title:"Obedience",verses:"{I}{B}WEB\\Hebrews\\5:8{/I}{/B}{BR}{BR}8  though he was a Son, yet learned obedience by the things which he suffered.\r {BR}{BR}"},{id:"38",scripture:"1 Thessalonians\\5:6",analysis:"Positive Mental Qualities",title:"Observation",verses:"{I}{B}WEB\\1 Thessalonians\\5:6{/I}{/B}{BR}{BR}6  so then let's not sleep, as the rest do, but let's watch and be sober.\r {BR}{BR}"},{id:"39",scripture:"1 Peter\\3:15",analysis:"Positive Mental Qualities",title:"Open-mmdedness",verses:"{I}{B}WEB\\1 Peter\\3:15{/I}{/B}{BR}{BR}15  But sanctify the Lord God in your hearts; and always be ready to give an answer to everyone who asks you a reason concerning the hope that is in you, with humility and fear:\r {BR}{BR}"},{id:"40",scripture:"Romans\\8:28",analysis:"Positive Mental Qualities",title:"Optimism",verses:"{I}{B}WEB\\Romans\\8:28{/I}{/B}{BR}{BR}28  We know that all things work together for good for those who love God, to those who are called according to his purpose.\r {BR}{BR}"},{id:"41",scripture:"Revelation\\21:5",analysis:"Positive Mental Qualities",title:"Originality",verses:"{I}{B}WEB\\Revelation\\21:5{/I}{/B}{BR}{BR}5  He who sits on the throne said, {I}{B}Behold, I am making all things new.{/B}{/I} He said, {I}{B}Write, for these words of God are faithful and true.{/B}{/I}\r {BR}{BR}"},{id:"42",scripture:"Luke\\8:15",analysis:"Positive Mental Qualities",title:"Patience",verses:"{I}{B}WEB\\Luke\\8:15{/I}{/B}{BR}{BR}15  {I}{B}That in the good ground, these are such as in an honest and good heart, having heard the word, hold it tightly, and bring forth fruit with patience.{/B}{/I}\r {BR}{BR}"},{id:"43",scripture:"Romans\\13:1-7",analysis:"Positive Mental Qualities",title:"Patriotism",verses:"{I}{B}WEB\\Romans\\13:1-7{/I}{/B}{BR}{BR}1  Let every soul be in subjection to the higher authorities, for there is no authority except from God, and those who exist are ordained by God.\r {BR}2  Therefore he who resists the authority, withstands the ordinance of God; and those who withstand will receive to themselves judgment.\r {BR}3  For rulers are not a terror to the good work, but to the evil. Do you desire to have no fear of the authority? Do that which is good, and you will have praise from the same,\r {BR}4  for he is a servant of God to you for good. But if you do that which is evil, be afraid, for he doesn't bear the sword in vain; for he is a servant of God, an avenger for wrath to him who does evil.\r {BR}5  Therefore you need to be in subjection, not only because of the wrath, but also for conscience' sake.\r {BR}6  For this reason you also pay taxes, for they are servants of God's service, attending continually on this very thing.\r {BR}7  Give therefore to everyone what you owe: taxes to whom taxes are due; customs to whom customs; respect to whom respect; honor to whom honor.\r {BR}{BR}"},{id:"44",scripture:"1 Corinthians\\15:58",analysis:"Positive Mental Qualities",title:"Perseverance",verses:"{I}{B}WEB\\1 Corinthians\\15:58{/I}{/B}{BR}{BR}58  Therefore, my beloved brothers, be steadfast, immovable, always abounding in the Lord's work, because you know that your labor is not in vain in the Lord.\r {BR}{BR}"},{id:"45",scripture:"1 Peter\\3:8",analysis:"Positive Mental Qualities",title:"Politeness",verses:"{I}{B}WEB\\1 Peter\\3:8{/I}{/B}{BR}{BR}8  Finally, be all like-minded, compassionate, loving as brothers, tenderhearted, courteous,\r {BR}{BR}"},{id:"46",scripture:"Proverbs\\12:23",analysis:"Positive Mental Qualities",title:"Prudence",verses:"{I}{B}WEB\\Proverbs\\12:23{/I}{/B}{BR}{BR}23  A prudent man keeps his knowledge, but the hearts of fools proclaim foolishness.\r {BR}{BR}"},{id:"47",scripture:"Luke\\9:51",analysis:"Positive Mental Qualities",title:"Purpose",verses:"{I}{B}WEB\\Luke\\9:51{/I}{/B}{BR}{BR}51  It came to pass, when the days were near that he should be taken up, he intently set his face to go to Jerusalem,\r {BR}{BR}"},{id:"48",scripture:"Proverbs\\26:16",analysis:"Positive Mental Qualities",title:"Reason",verses:"{I}{B}WEB\\Proverbs\\26:16{/I}{/B}{BR}{BR}16  The sluggard is wiser in his own eyes than seven men who answer with discretion.\r {BR}{BR}"},{id:"49",scripture:"James\\1:27",analysis:"Positive Mental Qualities",title:"Religion",verses:"{I}{B}WEB\\James\\1:27{/I}{/B}{BR}{BR}27  Pure religion and undefiled before our God and Father is this: to visit the fatherless and widows in their affliction, and to keep oneself unstained by the world.\r {BR}{BR}"},{id:"50",scripture:"Exodus\\22:3-12",analysis:"Positive Mental Qualities",title:"Restitution",verses:"{I}{B}WEB\\Exodus\\22:3-12{/I}{/B}{BR}{BR}3  If the sun has risen on him, there shall be guilt of bloodshed for him; he shall make restitution. If he has nothing, then he shall be sold for his theft.\r {BR}4  If the stolen property is found in his hand alive, whether it is ox, donkey, or sheep, he shall pay double.\r {BR}5  If a man causes a field or vineyard to be eaten, and lets his animal loose, and it grazes in another man's field, he shall make restitution from the best of his own field, and from the best of his own vineyard.\r {BR}6  If fire breaks out, and catches in thorns so that the shocks of grain, or the standing grain, or the field are consumed; he who kindled the fire shall surely make restitution.\r {BR}7  If a man delivers to his neighbor money or stuff to keep, and it is stolen out of the man's house; if the thief is found, he shall pay double.\r {BR}8  If the thief isn't found, then the master of the house shall come near to God, to find out if he hasn't put his hand to his neighbor's goods.\r {BR}9  For every matter of trespass, whether it be for ox, for donkey, for sheep, for clothing, or for any kind of lost thing, about which one says, 'This is mine,' the cause of both parties shall come before God. He whom God condemns shall pay double to his neighbor.\r {BR}10  If a man delivers to his neighbor a donkey, an ox, a sheep, or any animal to keep, and it dies or is injured, or driven away, no man seeing it;\r {BR}11  the oath of Yahweh shall be between them both, whether he hasn't put his hand to his neighbor's goods; and its owner shall accept it, and he shall not make restitution.\r {BR}12  But if it is stolen from him, he shall make restitution to its owner.\r {BR}{BR}"},{id:"51",scripture:"Proverbs\\16:32",analysis:"Positive Mental Qualities",title:"Self-control",verses:"{I}{B}WEB\\Proverbs\\16:32{/I}{/B}{BR}{BR}32  One who is slow to anger is better than the mighty; one who rules his spirit, than he who takes a city.\r {BR}{BR}"},{id:"52",scripture:"1 Timothy\\4:16",analysis:"Positive Mental Qualities",title:"Self-respect",verses:"{I}{B}WEB\\1 Timothy\\4:16{/I}{/B}{BR}{BR}16  Pay attention to yourself, and to your teaching. Continue in these things, for in doing this you will save both yourself and those who hear you.\r {BR}{BR}"},{id:"53",scripture:"Acts\\24:16",analysis:"Positive Mental Qualities",title:"Sincerity",verses:"{I}{B}WEB\\Acts\\24:16{/I}{/B}{BR}{BR}16  Herein I also practice always having a conscience void of offense toward God and men.\r {BR}{BR}"},{id:"54",scripture:"1 Peter\\3:8",analysis:"Positive Mental Qualities",title:"Sympathy",verses:"{I}{B}WEB\\1 Peter\\3:8{/I}{/B}{BR}{BR}8  Finally, be all like-minded, compassionate, loving as brothers, tenderhearted, courteous,\r {BR}{BR}"},{id:"55",scripture:"1 Corinthians\\14:40",analysis:"Positive Mental Qualities",title:"System",verses:"{I}{B}WEB\\1 Corinthians\\14:40{/I}{/B}{BR}{BR}40  Let all things be done decently and in order.\r {BR}{BR}"},{id:"56",scripture:"1 Corinthians\\9:19-22",analysis:"Positive Mental Qualities",title:"Tact",verses:"{I}{B}WEB\\1 Corinthians\\9:19-22{/I}{/B}{BR}{BR}19  For though I was free from all, I brought myself under bondage to all, that I might gain the more.\r {BR}20  To the Jews I became as a Jew, that I might gain Jews; to those who are under the law, as under the law, that I might gain those who are under the law;\r {BR}21  to those who are without law, as without law  (not being without law toward God, but under law toward Christ), that I might win those who are without law.\r {BR}22  To the weak I became as weak, that I might gain the weak. I have become all things to all men, that I may by all means save some.\r {BR}{BR}"},{id:"57",scripture:"Proverbs\\18:15",analysis:"Positive Mental Qualities",title:"Teachableness",verses:"{I}{B}WEB\\Proverbs\\18:15{/I}{/B}{BR}{BR}15  The heart of the discerning gets knowledge. The ear of the wise seeks knowledge.\r {BR}{BR}"},{id:"58",scripture:"2 Peter\\1:6",analysis:"Positive Mental Qualities",title:"Temperance",verses:"{I}{B}WEB\\2 Peter\\1:6{/I}{/B}{BR}{BR}6  and in knowledge, self-control; and in self-control patience; and in patience godliness;\r {BR}{BR}"},{id:"59",scripture:"1 John\\5:4",analysis:"Positive Mental Qualities",title:"The conquering spirit",verses:"{I}{B}WEB\\1 John\\5:4{/I}{/B}{BR}{BR}4  For whatever is born of God overcomes the world. This is the victory that has overcome the world: your faith.\r {BR}{BR}"},{id:"60",scripture:"1 Corinthians\\16:2",analysis:"Positive Mental Qualities",title:"Thrift; saving",verses:"{I}{B}WEB\\1 Corinthians\\16:2{/I}{/B}{BR}{BR}2  On the first day of the week, let each one of you save, as he may prosper, that no collections be made when I come.\r {BR}{BR}"},{id:"61",scripture:"Proverbs\\28:25",analysis:"Positive Mental Qualities",title:"Trust",verses:"{I}{B}WEB\\Proverbs\\28:25{/I}{/B}{BR}{BR}25  One who is greedy stirs up strife; but one who trusts in Yahweh will prosper.\r {BR}{BR}"},{id:"62",scripture:"Ephesians\\6:4",analysis:"Positive Mental Qualities",title:"Truth",verses:"{I}{B}WEB\\Ephesians\\6:4{/I}{/B}{BR}{BR}4  You fathers, don't provoke your children to wrath, but nurture them in the discipline and instruction of the Lord.\r {BR}{BR}"},{id:"63",scripture:"Philippians\\2:4",analysis:"Positive Mental Qualities",title:"Unselfishness",verses:"{I}{B}WEB\\Philippians\\2:4{/I}{/B}{BR}{BR}4  each of you not just looking to his own things, but each of you also to the things of others.\r {BR}{BR}"},{id:"64",scripture:"Proverbs\\3:13",analysis:"Positive Mental Qualities",title:"Wisdom",verses:"{I}{B}WEB\\Proverbs\\3:13{/I}{/B}{BR}{BR}13  Happy is the man who finds wisdom, the man who gets understanding.\r {BR}{BR}"},{id:"65",scripture:"Mark\\13:34\\",analysis:"Positive Mental Qualities",title:"Work",verses:"{I}{B}WEB\\Mark\\13:34\\{/I}{/B}{BR}{BR}34  {I}{B}It is like a man, traveling to another country, having left his house, and given authority to his servants, and to each one his work, and also commanded the doorkeeper to keep watch.{/B}{/I}\r {BR}{BR}"},{id:"66",scripture:"Proverbs\\15:1",analysis:"Negative Mental Qualities",title:"Disagreeableness",verses:"{I}{B}WEB\\Proverbs\\15:1{/I}{/B}{BR}{BR}1  A gentle answer turns away wrath, but a harsh word stirs up anger.\r {BR}{BR}"},{id:"67",scripture:"Luke\\12:19",analysis:"Negative Mental Qualities",title:"Satisfaction",verses:"{I}{B}WEB\\Luke\\12:19{/I}{/B}{BR}{BR}19  {I}{B}I will tell my soul, Soul, you have many goods laid up for many years. Take your ease, eat, drink, be merry. '{/B}{/I}\r {BR}{BR}"},{id:"68",scripture:"Jeremiah\\3:25",analysis:"Negative Mental Qualities",title:"Confusion",verses:"{I}{B}WEB\\Jeremiah\\3:25{/I}{/B}{BR}{BR}25  Let us lie down in our shame, and let our confusion cover us; for we have sinned against Yahweh our God, we and our fathers, from our youth even to this day; and we have not obeyed the voice of Yahweh our God.\r {BR}{BR}"},{id:"69",scripture:"1 Corinthians\\13:5",analysis:"Negative Mental Qualities",title:"Ugliness",verses:"{I}{B}WEB\\1 Corinthians\\13:5{/I}{/B}{BR}{BR}5  doesn't behave itself inappropriately, doesn't seek its own way, is not provoked, takes no account of evil;\r {BR}{BR}"},{id:"70",scripture:"1 Peter\\2:1",analysis:"Negative Mental Qualities",title:"Malice",verses:"{I}{B}WEB\\1 Peter\\2:1{/I}{/B}{BR}{BR}1  Putting away therefore all wickedness, all deceit, hypocrisies, envies, and all evil speaking,\r {BR}{BR}"},{id:"71",scripture:"Matthew\\6:16",analysis:"Negative Mental Qualities",title:"Gloominess",verses:"{I}{B}WEB\\Matthew\\6:16{/I}{/B}{BR}{BR}16  {I}{B}Moreover when you fast, don't be like the hypocrites, with sad faces. For they disfigure their faces, that they may be seen by men to be fasting. Most certainly I tell you, they have received their reward.{/B}{/I}\r {BR}{BR}"},{id:"72",scripture:"Galatians\\1:6",analysis:"Negative Mental Qualities",title:"Vacillation",verses:"{I}{B}WEB\\Galatians\\1:6{/I}{/B}{BR}{BR}6  I marvel that you are so quickly deserting him who called you in the grace of Christ to a different good news;\r {BR}{BR}"},{id:"73",scripture:"Proverbs\\29:25",analysis:"Negative Mental Qualities",title:"Fear",verses:"{I}{B}WEB\\Proverbs\\29:25{/I}{/B}{BR}{BR}25  The fear of man proves to be a snare, but whoever puts his trust in Yahweh is kept safe.\r {BR}{BR}"},{id:"74",scripture:"Exodus\\16:3",analysis:"Negative Mental Qualities",title:"Dissatisfaction",verses:"{I}{B}WEB\\Exodus\\16:3{/I}{/B}{BR}{BR}3  and the children of Israel said to them, We wish that we had died by the hand of Yahweh in the land of Egypt, when we sat by the meat pots, when we ate our fill of bread, for you have brought us out into this wilderness, to kill this whole assembly with hunger.\r {BR}{BR}"},{id:"75",scripture:"Proverbs\\29:25",analysis:"Negative Mental Qualities",title:"Cowardice",verses:"{I}{B}WEB\\Proverbs\\29:25{/I}{/B}{BR}{BR}25  The fear of man proves to be a snare, but whoever puts his trust in Yahweh is kept safe.\r {BR}{BR}"},{id:"76",scripture:"1 Corinthians\\13:5",analysis:"Negative Mental Qualities",title:"Discourtesy",verses:"{I}{B}WEB\\1 Corinthians\\13:5{/I}{/B}{BR}{BR}5  doesn't behave itself inappropriately, doesn't seek its own way, is not provoked, takes no account of evil;\r {BR}{BR}"},{id:"77",scripture:"James\\1:8",analysis:"Negative Mental Qualities",title:"Indecision",verses:"{I}{B}WEB\\James\\1:8{/I}{/B}{BR}{BR}8  He is a double-minded man, unstable in all his ways.\r {BR}{BR}"},{id:"78",scripture:"Proverbs\\7:13",analysis:"Negative Mental Qualities",title:"Impudence",verses:"{I}{B}WEB\\Proverbs\\7:13{/I}{/B}{BR}{BR}13  So she caught him, and kissed him. With an impudent face she said to him:\r {BR}{BR}"},{id:"79",scripture:"Proverbs\\6:6",analysis:"Negative Mental Qualities",title:"Dullness",verses:"{I}{B}WEB\\Proverbs\\6:6{/I}{/B}{BR}{BR}6  Go to the ant, you sluggard. Consider her ways, and be wise;\r {BR}{BR}"},{id:"80",scripture:"Ecclesiastes\\5:2",analysis:"Negative Mental Qualities",title:"Imprudence",verses:"{I}{B}WEB\\Ecclesiastes\\5:2{/I}{/B}{BR}{BR}2  Don't be rash with your mouth, and don't let your heart be hasty to utter anything before God; for God is in heaven, and you on earth. Therefore let your words be few.\r {BR}{BR}"},{id:"81",scripture:"Colossians\\3:21",analysis:"Negative Mental Qualities",title:"Discouragement",verses:"{I}{B}WEB\\Colossians\\3:21{/I}{/B}{BR}{BR}21  Fathers, don't provoke your children, so that they won't be discouraged.\r {BR}{BR}"},{id:"82",scripture:"Micah\\3:6",analysis:"Negative Mental Qualities",title:"Darkness",verses:"{I}{B}WEB\\Micah\\3:6{/I}{/B}{BR}{BR}6  Therefore night is over you, with no vision, and it is dark to you, that you may not divine; and the sun will go down on the prophets, and the day will be black over them.\r {BR}{BR}"},{id:"83",scripture:"Amos\\6:1",analysis:"Negative Mental Qualities",title:"Indifference",verses:"{I}{B}WEB\\Amos\\6:1{/I}{/B}{BR}{BR}1  Woe to those who are at ease in Zion, and to those who are secure on the mountain of Samaria, the notable men of the chief of the nations, to whom the house of Israel come!\r {BR}{BR}"},{id:"84",scripture:"Song of Solomon\\8:6",analysis:"Negative Mental Qualities",title:"Suspicion",verses:"{I}{B}WEB\\Song of Solomon\\8:6{/I}{/B}{BR}{BR}6  Set me as a seal on your heart, as a seal on your arm; for love is strong as death. Jealousy is as cruel as Sheol. Its flashes are flashes of fire, a very flame of Yahweh.\r {BR}{BR}"},{id:"85",scripture:"Proverbs\\19:2",analysis:"Negative Mental Qualities",title:"Rashness",verses:"{I}{B}WEB\\Proverbs\\19:2{/I}{/B}{BR}{BR}2  It isn't good to have zeal without knowledge; nor being hasty with one's feet and missing the way.\r {BR}{BR}"},{id:"86",scripture:"Proverbs\\18:9",analysis:"Negative Mental Qualities",title:"Improvidence",verses:"{I}{B}WEB\\Proverbs\\18:9{/I}{/B}{BR}{BR}9  One who is slack in his work is brother to him who is a master of destruction.\r {BR}{BR}"},{id:"87",scripture:"Romans\\2:9",analysis:"Negative Mental Qualities",title:"Misery",verses:"{I}{B}WEB\\Romans\\2:9{/I}{/B}{BR}{BR}9  oppression and anguish, on every soul of man who works evil, to the Jew first, and also to the Greek.\r {BR}{BR}"},{id:"88",scripture:"2 Corinthians\\4:2",analysis:"Negative Mental Qualities",title:"Dishonesty",verses:"{I}{B}WEB\\2 Corinthians\\4:2{/I}{/B}{BR}{BR}2  But we have renounced the hidden things of shame, not walking in craftiness, nor handling the word of God deceitfully; but by the manifestation of the truth commending ourselves to every man's conscience in the sight of God.\r {BR}{BR}"},{id:"89",scripture:"Romans\\2:23",analysis:"Negative Mental Qualities",title:"Dishonor",verses:"{I}{B}WEB\\Romans\\2:23{/I}{/B}{BR}{BR}23  You who glory in the law, through your disobedience of the law do you dishonor God?\r {BR}{BR}"},{id:"90",scripture:"Ephesians\\2:12",analysis:"Negative Mental Qualities",title:"Despair",verses:"{I}{B}WEB\\Ephesians\\2:12{/I}{/B}{BR}{BR}12  that you were at that time separate from Christ, alienated from the commonwealth of Israel, and strangers from the covenants of the promise, having no hope and without God in the world.\r {BR}{BR}"},{id:"91",scripture:"Deuteronomy\\1:6",analysis:"Negative Mental Qualities",title:"Inaction",verses:"{I}{B}WEB\\Deuteronomy\\1:6{/I}{/B}{BR}{BR}6  Yahweh our God spoke to us in Horeb, saying, You have lived long enough in this mountain:\r {BR}{BR}"},{id:"92",scripture:"Luke\\12:20",analysis:"Negative Mental Qualities",title:"Stupidity",verses:"{I}{B}WEB\\Luke\\12:20{/I}{/B}{BR}{BR}20  {I}{B}But God said to him, 'You foolish one, tonight your soul is required of you. The things which you have prepared-whose will they be?'{/B}{/I}\r {BR}{BR}"},{id:"93",scripture:"2 Corinthians\\7:10",analysis:"Negative Mental Qualities",title:"Sorrow",verses:"{I}{B}WEB\\2 Corinthians\\7:10{/I}{/B}{BR}{BR}10  For godly sorrow works repentance to salvation, which brings no regret. But the sorrow of the world works death.\r {BR}{BR}"},{id:"94",scripture:"Matthew\\7:3-6",analysis:"Negative Mental Qualities",title:"Indiscrimination",verses:"{I}{B}WEB\\Matthew\\7:3-6{/I}{/B}{BR}{BR}3  {I}{B}Why do you see the speck that is in your brother's eye, but don't consider the beam that is in your own eye?{/B}{/I}\r {BR}4  {I}{B}Or how will you tell your brother, 'Let me remove the speck from your eye;' and behold, the beam is in your own eye?{/B}{/I}\r {BR}5  {I}{B}You hypocrite! First remove the beam out of your own eye, and then you can see clearly to remove the speck out of your brother's eye.{/B}{/I}\r {BR}6  {I}{B}Don't give that which is holy to the dogs, neither throw your pearls before the pigs, lest perhaps they trample them under their feet, and turn and tear you to pieces.{/B}{/I}\r {BR}{BR}"},{id:"95",scripture:"Job\\17:16",analysis:"Negative Mental Qualities",title:"Injustice",verses:"{I}{B}WEB\\Job\\17:16{/I}{/B}{BR}{BR}16  Shall it go down with me to the gates of Sheol, or descend together into the dust?\r {BR}{BR}"},{id:"96",scripture:"Matthew\\25:24",analysis:"Negative Mental Qualities",title:"Harshness",verses:"{I}{B}WEB\\Matthew\\25:24{/I}{/B}{BR}{BR}24  {I}{B}He also who had received the one talent came and said, 'Lord, I knew you that you are a hard man, reaping where you did not sow, and gathering where you did not scatter.{/B}{/I}\r {BR}{BR}"},{id:"97",scripture:"Romans\\10:3",analysis:"Negative Mental Qualities",title:"Ignorance",verses:"{I}{B}WEB\\Romans\\10:3{/I}{/B}{BR}{BR}3  For being ignorant of God's righteousness, and seeking to establish their own righteousness, they didn't subject themselves to the righteousness of God.\r {BR}{BR}"},{id:"98",scripture:"2 Corinthians\\9:6-7",analysis:"Negative Mental Qualities",title:"Stinginess",verses:"{I}{B}WEB\\2 Corinthians\\9:6-7{/I}{/B}{BR}{BR}6  Remember this: he who sows sparingly will also reap sparingly. He who sows bountifully will also reap bountifully.\r {BR}7  Let each man give according as he has determined in his heart; not grudgingly, or under compulsion; for God loves a cheerful giver.\r {BR}{BR}"},{id:"99",scripture:"Galatians\\5:20",analysis:"Negative Mental Qualities",title:"Hate",verses:"{I}{B}WEB\\Galatians\\5:20{/I}{/B}{BR}{BR}20  idolatry, sorcery, hatred, strife, jealousies, outbursts of anger, rivalries, divisions, heresies,\r {BR}{BR}"},{id:"100",scripture:"Proverbs\\25:19",analysis:"Negative Mental Qualities",title:"Disloyalty",verses:"{I}{B}WEB\\Proverbs\\25:19{/I}{/B}{BR}{BR}19  Confidence in someone unfaithful in time of trouble is like a bad tooth, or a lame foot.\r {BR}{BR}"},{id:"101",scripture:"Proverbs\\6:24-26",analysis:"Negative Mental Qualities",title:"Immorality",verses:"{I}{B}WEB\\Proverbs\\6:24-26{/I}{/B}{BR}{BR}24  to keep you from the immoral woman, from the flattery of the wayward wife's tongue.\r {BR}25  Don't lust after her beauty in your heart, neither let her captivate you with her eyelids.\r {BR}26  For a prostitute reduces you to a piece of bread. The adulteress hunts for your precious life.\r {BR}{BR}"},{id:"102",scripture:"Hebrews\\4:7",analysis:"Negative Mental Qualities",title:"Insubordination",verses:"{I}{B}WEB\\Hebrews\\4:7{/I}{/B}{BR}{BR}7  he again defines a certain day, today, saying through David so long a time afterward  (just as has been said), Today if you will hear his voice, don't harden your hearts.\r {BR}{BR}"},{id:"103",scripture:"Proverbs\\29:1",analysis:"Negative Mental Qualities",title:"Heedlessness",verses:"{I}{B}WEB\\Proverbs\\29:1{/I}{/B}{BR}{BR}1  He who is often rebuked and stiffens his neck will be destroyed suddenly, with no remedy.\r {BR}{BR}"},{id:"104",scripture:"Romans\\12:16",analysis:"Negative Mental Qualities",title:"Egotism",verses:"{I}{B}WEB\\Romans\\12:16{/I}{/B}{BR}{BR}16  Be of the same mind one toward another. Don't set your mind on high things, but associate with the humble. Don't be wise in your own conceits.\r {BR}{BR}"},{id:"105",scripture:"Psalms\\13:1-2",analysis:"Negative Mental Qualities",title:"Pessimism",verses:"{I}{B}WEB\\Psalms\\13:1-2{/I}{/B}{BR}{BR}1  How long, Yahweh? Will you forget me forever? How long will you hide your face from me?\r {BR}2  How long shall I take counsel in my soul, having sorrow in my heart every day? How long shall my enemy triumph over me?\r {BR}{BR}"},{id:"106",scripture:"Proverbs\\6:6",analysis:"Negative Mental Qualities",title:"Dullness",verses:"{I}{B}WEB\\Proverbs\\6:6{/I}{/B}{BR}{BR}6  Go to the ant, you sluggard. Consider her ways, and be wise;\r {BR}{BR}"},{id:"107",scripture:"Luke\\9:54",analysis:"Negative Mental Qualities",title:"Impatience",verses:"{I}{B}WEB\\Luke\\9:54{/I}{/B}{BR}{BR}54  When his disciples, James and John, saw this, they said, Lord, do you want us to command fire to come down from the sky, and destroy them, just as Elijah did?\r {BR}{BR}"},{id:"108",scripture:"1 Kings\\16:19-20",analysis:"Negative Mental Qualities",title:"Treason",verses:"{I}{B}WEB\\1 Kings\\16:19-20{/I}{/B}{BR}{BR}19  for his sins which he sinned in doing that which was evil in the sight of Yahweh, in walking in the way of Jeroboam, and in his sin which he did, to make Israel to sin.\r {BR}20  Now the rest of the acts of Zimri, and his treason that he did, aren't they written in the book of the chronicles of the kings of Israel?\r {BR}{BR}"},{id:"109",scripture:"1 Kings\\18:21",analysis:"Negative Mental Qualities",title:"Hesitation",verses:"{I}{B}WEB\\1 Kings\\18:21{/I}{/B}{BR}{BR}21  Elijah came near to all the people, and said, How long will you waver between the two sides? If Yahweh is God, follow him; but if Baal, then follow him. The people answered him not a word.\r {BR}{BR}"},{id:"110",scripture:"1 Corinthians\\13:5",analysis:"Negative Mental Qualities",title:"Incivility",verses:"{I}{B}WEB\\1 Corinthians\\13:5{/I}{/B}{BR}{BR}5  doesn't behave itself inappropriately, doesn't seek its own way, is not provoked, takes no account of evil;\r {BR}{BR}"},{id:"111",scripture:"Ecclesiastes\\5:2",analysis:"Negative Mental Qualities",title:"Imprudence",verses:"{I}{B}WEB\\Ecclesiastes\\5:2{/I}{/B}{BR}{BR}2  Don't be rash with your mouth, and don't let your heart be hasty to utter anything before God; for God is in heaven, and you on earth. Therefore let your words be few.\r {BR}{BR}"},{id:"112",scripture:"2 Timothy\\3:7",analysis:"Negative Mental Qualities",title:"Irresolution",verses:"{I}{B}WEB\\2 Timothy\\3:7{/I}{/B}{BR}{BR}7  always learning, and never able to come to the knowledge of the truth.\r {BR}{BR}"},{id:"113",scripture:"Proverbs\\10:10",analysis:"Negative Mental Qualities",title:"Imbecility",verses:"{I}{B}WEB\\Proverbs\\10:10{/I}{/B}{BR}{BR}10  One winking with the eye causes sorrow, but a chattering fool will fall.\r {BR}{BR}"},{id:"114",scripture:"Psalms\\14:1",analysis:"Negative Mental Qualities",title:"Atheism",verses:"{I}{B}WEB\\Psalms\\14:1{/I}{/B}{BR}{BR}1  The fool has said in his heart, There is no God. They are corrupt. They have done abominable works. There is none who does good.\r {BR}{BR}"},{id:"115",scripture:"Matthew\\25:28-29",analysis:"Negative Mental Qualities",title:"Deprivation",verses:"{I}{B}WEB\\Matthew\\25:28-29{/I}{/B}{BR}{BR}28  {I}{B}Take away therefore the talent from him, and give it to him who has the ten talents.{/B}{/I}\r {BR}29  {I}{B}For to everyone who has will be given, and he will have abundance, but from him who doesn't have, even that which he has will be taken away.{/B}{/I}\r {BR}{BR}"},{id:"116",scripture:"Proverbs\\25:8",analysis:"Negative Mental Qualities",title:"Impulsiveness",verses:"{I}{B}WEB\\Proverbs\\25:8{/I}{/B}{BR}{BR}8  Don't be hasty in bringing charges to court. What will you do in the end when your neighbor shames you?\r {BR}{BR}"},{id:"117",scripture:"Isaiah\\57:9",analysis:"Negative Mental Qualities",title:"Debasement",verses:"{I}{B}WEB\\Isaiah\\57:9{/I}{/B}{BR}{BR}9  You went to the king with oil, and did increase your perfumes, and did send your ambassadors far off, and did debase yourself even to Sheol.\r {BR}{BR}"},{id:"118",scripture:"Philippians\\1:16",analysis:"Negative Mental Qualities",title:"Insincerity",verses:"{I}{B}WEB\\Philippians\\1:16{/I}{/B}{BR}{BR}16  The former insincerely preach Christ from selfish ambition, thinking that they add affliction to my chains;\r {BR}{BR}"},{id:"119",scripture:"Ephesians\\4:19",analysis:"Negative Mental Qualities",title:"Uncompassionateness",verses:"{I}{B}WEB\\Ephesians\\4:19{/I}{/B}{BR}{BR}19  who having become callous gave themselves up to lust, to work all uncleanness with greediness.\r {BR}{BR}"},{id:"120",scripture:"Isaiah\\47:8",analysis:"Negative Mental Qualities",title:"Carelessness",verses:"{I}{B}WEB\\Isaiah\\47:8{/I}{/B}{BR}{BR}8  Now therefore hear this, you who are given to pleasures, who sit securely, who say in your heart, I am, and there is none else besides me; I shall not sit as a widow, neither shall I know the loss of children:\r {BR}{BR}"},{id:"121",scripture:"Proverbs\\11:22",analysis:"Negative Mental Qualities",title:"Indiscretion",verses:"{I}{B}WEB\\Proverbs\\11:22{/I}{/B}{BR}{BR}22  Like a gold ring in a pig's snout, is a beautiful woman who lacks discretion.\r {BR}{BR}"},{id:"122",scripture:"Jeremiah\\6:10",analysis:"Negative Mental Qualities",title:"Inexorability",verses:"{I}{B}WEB\\Jeremiah\\6:10{/I}{/B}{BR}{BR}10  To whom shall I speak and testify, that they may hear? behold, their ear is uncircumcised, and they can't listen: behold, the word of Yahweh is become to them a reproach; they have no delight in it.\r {BR}{BR}"},{id:"123",scripture:"Proverbs\\23:29-30",analysis:"Negative Mental Qualities",title:"Intemperance",verses:"{I}{B}WEB\\Proverbs\\23:29-30{/I}{/B}{BR}{BR}29  Who has woe? Who has sorrow? Who has strife? Who has complaints? Who has needless bruises? Who has bloodshot eyes?\r {BR}30  Those who stay long at the wine; those who go to seek out mixed wine.\r {BR}{BR}"},{id:"124",scripture:"Jude\\1:13",analysis:"Negative Mental Qualities",title:"Aimlessness",verses:"{I}{B}WEB\\Jude\\1:13{/I}{/B}{BR}{BR}13  wild waves of the sea, foaming out their own shame; wandering stars, for whom the blackness of darkness has been reserved forever.\r {BR}{BR}"},{id:"125",scripture:"Luke\\15:12-17",analysis:"Negative Mental Qualities",title:"Extravagance",verses:"{I}{B}WEB\\Luke\\15:12-17{/I}{/B}{BR}{BR}12  {I}{B}The younger of them said to his father, 'Father, give me my share of your property.' He divided his livelihood between them.{/B}{/I}\r {BR}13  {I}{B}Not many days after, the younger son gathered all of this together and traveled into a far country. There he wasted his property with riotous living.{/B}{/I}\r {BR}14  {I}{B}When he had spent all of it, there arose a severe famine in that country, and he began to be in need.{/B}{/I}\r {BR}15  {I}{B}He went and joined himself to one of the citizens of that country, and he sent him into his fields to feed pigs.{/B}{/I}\r {BR}16  {I}{B}He wanted to fill his belly with the husks that the pigs ate, but no one gave him any.{/B}{/I}\r {BR}17  {I}{B}But when he came to himself he said, 'How many hired servants of my father's have bread enough to spare, and I'm dying with hunger!{/B}{/I}\r {BR}{BR}"},{id:"126",scripture:"Song of Solomon\\8:6",analysis:"Negative Mental Qualities",title:"Suspicion",verses:"{I}{B}WEB\\Song of Solomon\\8:6{/I}{/B}{BR}{BR}6  Set me as a seal on your heart, as a seal on your arm; for love is strong as death. Jealousy is as cruel as Sheol. Its flashes are flashes of fire, a very flame of Yahweh.\r {BR}{BR}"},{id:"127",scripture:"Proverbs\\20:17",analysis:"Negative Mental Qualities",title:"Falsehood",verses:"{I}{B}WEB\\Proverbs\\20:17{/I}{/B}{BR}{BR}17  Fraudulent food is sweet to a man, but afterwards his mouth is filled with gravel.\r {BR}{BR}"},{id:"128",scripture:"1 Corinthians\\13:5",analysis:"Negative Mental Qualities",title:"Selfishness",verses:"{I}{B}WEB\\1 Corinthians\\13:5{/I}{/B}{BR}{BR}5  doesn't behave itself inappropriately, doesn't seek its own way, is not provoked, takes no account of evil;\r {BR}{BR}"},{id:"129",scripture:"Proverbs\\15:14",analysis:"Negative Mental Qualities",title:"Foolishness",verses:"{I}{B}WEB\\Proverbs\\15:14{/I}{/B}{BR}{BR}14  The heart of one who has understanding seeks knowledge, but the mouths of fools feed on folly.\r {BR}{BR}"},{id:"130",scripture:"Romans\\12:11\\",analysis:"Negative Mental Qualities",title:"Laziness",verses:"{I}{B}WEB\\Romans\\12:11\\{/I}{/B}{BR}{BR}11  not lagging in diligence; fervent in spirit; serving the Lord;\r {BR}{BR}"},{id:"131",scripture:"Romans\\12:9",analysis:"Positive Spiritual Qualities",title:"Abhorrence of evil",verses:"{I}{B}WEB\\Romans\\12:9{/I}{/B}{BR}{BR}9  Let love be without hypocrisy. Abhor that which is evil. Cling to that which is good.\r {BR}{BR}"},{id:"132",scripture:"John\\15:4-10",analysis:"Positive Spiritual Qualities",title:"Abiding in Christ",verses:"{I}{B}WEB\\John\\15:4-10{/I}{/B}{BR}{BR}4  {I}{B}Remain in me, and I in you. As the branch can't bear fruit by itself, unless it remains in the vine, so neither can you, unless you remain in me.{/B}{/I}\r {BR}5  {I}{B}I am the vine. You are the branches. He who remains in me, and I in him, the same bears much fruit, for apart from me you can do nothing.{/B}{/I}\r {BR}6  {I}{B}If a man doesn't remain in me, he is thrown out as a branch, and is withered; and they gather them, throw them into the fire, and they are burned.{/B}{/I}\r {BR}7  {I}{B}If you remain in me, and my words remain in you, you will ask whatever you desire, and it will be done for you.{/B}{/I}\r {BR}8  {I}{B}In this is my Father glorified, that you bear much fruit; and so you will be my disciples.{/B}{/I}\r {BR}9  {I}{B}Even as the Father has loved me, I also have loved you. Remain in my love.{/B}{/I}\r {BR}10  {I}{B}If you keep my commandments, you will remain in my love; even as I have kept my Father's commandments, and remain in his love.{/B}{/I}\r {BR}{BR}"},{id:"133",scripture:"1 Peter\\2:11",analysis:"Positive Spiritual Qualities",title:"Abstinence",verses:"{I}{B}WEB\\1 Peter\\2:11{/I}{/B}{BR}{BR}11  Beloved, I beg you as foreigners and pilgrims, to abstain from fleshly lusts, which war against the soul;\r {BR}{BR}"},{id:"134",scripture:"John\\14:6",analysis:"Positive Spiritual Qualities",title:"Access to God",verses:"{I}{B}WEB\\John\\14:6{/I}{/B}{BR}{BR}6  Jesus said to him, {I}{B}I am the way, the truth, and the life. No one comes to the Father, except through me.{/B}{/I}\r {BR}{BR}"},{id:"135",scripture:"Hebrews\\10:22",analysis:"Positive Spiritual Qualities",title:"Assurance",verses:"{I}{B}WEB\\Hebrews\\10:22{/I}{/B}{BR}{BR}22  let's draw near with a true heart in fullness of faith, having our hearts sprinkled from an evil conscience, and having our body washed with pure water,\r {BR}{BR}"},{id:"136",scripture:"Luke\\10:34-35",analysis:"Positive Spiritual Qualities",title:"Beneficences",verses:"{I}{B}WEB\\Luke\\10:34-35{/I}{/B}{BR}{BR}34  {I}{B}came to him, and bound up his wounds, pouring on oil and wine. He set him on his own animal, and brought him to an inn, and took care of him.{/B}{/I}\r {BR}35  {I}{B}On the next day, when he departed, he took out two denarii, and gave them to the host, and said to him, 'Take care of him. Whatever you spend beyond that, I will repay you when I return.'{/B}{/I}\r {BR}{BR}"},{id:"137",scripture:"Proverbs\\11:25",analysis:"Positive Spiritual Qualities",title:"Benevolence",verses:"{I}{B}WEB\\Proverbs\\11:25{/I}{/B}{BR}{BR}25  The liberal soul shall be made fat. He who waters shall be watered also himself.\r {BR}{BR}"},{id:"138",scripture:"Philippians\\2:14-15",analysis:"Positive Spiritual Qualities",title:"Blamelessness",verses:"{I}{B}WEB\\Philippians\\2:14-15{/I}{/B}{BR}{BR}14  Do all things without murmurings and disputes,\r {BR}15  that you may become blameless and harmless, children of God without blemish in the midst of a crooked and perverse generation, among whom you are seen as lights in the world,\r {BR}{BR}"},{id:"139",scripture:"John\\13:12",analysis:"Positive Spiritual Qualities",title:"Brotherly love",verses:"{I}{B}WEB\\John\\13:12{/I}{/B}{BR}{BR}12  So when he had washed their feet, put his outer garment back on, and sat down again, he said to them, {I}{B}Do you know what I have done to you?{/B}{/I}\r {BR}{BR}"},{id:"140",scripture:"1 Peter\\3:2",analysis:"Positive Spiritual Qualities",title:"Chastity",verses:"{I}{B}WEB\\1 Peter\\3:2{/I}{/B}{BR}{BR}2  seeing your pure behavior in fear.\r {BR}{BR}"},{id:"141",scripture:"Mark\\10:15",analysis:"Positive Spiritual Qualities",title:"Childlikeness",verses:"{I}{B}WEB\\Mark\\10:15{/I}{/B}{BR}{BR}15  {I}{B}Most certainly I tell you, whoever will not receive the Kingdom of God like a little child, he will in no way enter into it.{/B}{/I}\r {BR}{BR}"},{id:"142",scripture:"Luke\\10:34",analysis:"Positive Spiritual Qualities",title:"Compassion",verses:"{I}{B}WEB\\Luke\\10:34{/I}{/B}{BR}{BR}34  {I}{B}came to him, and bound up his wounds, pouring on oil and wine. He set him on his own animal, and brought him to an inn, and took care of him.{/B}{/I}\r {BR}{BR}"},{id:"143",scripture:"1 John\\1:9",analysis:"Positive Spiritual Qualities",title:"Confession of sin",verses:"{I}{B}WEB\\1 John\\1:9{/I}{/B}{BR}{BR}9  If we confess our sins, he is faithful and righteous to forgive us the sins, and to cleanse us from all unrighteousness.\r {BR}{BR}"},{id:"144",scripture:"Hebrews\\10:35",analysis:"Positive Spiritual Qualities",title:"Confidence",verses:"{I}{B}WEB\\Hebrews\\10:35{/I}{/B}{BR}{BR}35  Therefore don't throw away your boldness, which has a great reward.\r {BR}{BR}"},{id:"145",scripture:"Acts\\24:16",analysis:"Positive Spiritual Qualities",title:"Conscientiousness",verses:"{I}{B}WEB\\Acts\\24:16{/I}{/B}{BR}{BR}16  Herein I also practice always having a conscience void of offense toward God and men.\r {BR}{BR}"},{id:"146",scripture:"Exodus\\32:29",analysis:"Positive Spiritual Qualities",title:"Consecration",verses:"{I}{B}WEB\\Exodus\\32:29{/I}{/B}{BR}{BR}29  Moses said, Consecrate yourselves today to Yahweh, yes, every man against his son, and against his brother; that he may bestow on you a blessing this day.\r {BR}{BR}"},{id:"147",scripture:"Joshua\\1:7",analysis:"Positive Spiritual Qualities",title:"Courage",verses:"{I}{B}WEB\\Joshua\\1:7{/I}{/B}{BR}{BR}7  Only be strong and very courageous, to observe to do according to all the law, which Moses my servant commanded you. Don't turn from it to the right hand or to the left, that you may have good success wherever you go.\r {BR}{BR}"},{id:"148",scripture:"Proverbs\\4:23",analysis:"Positive Spiritual Qualities",title:"Diligence",verses:"{I}{B}WEB\\Proverbs\\4:23{/I}{/B}{BR}{BR}23  Keep your heart with all diligence, for out of it is the wellspring of life.\r {BR}{BR}"},{id:"149",scripture:"Philippians\\3:13-14",analysis:"Positive Spiritual Qualities",title:"Earnestness",verses:"{I}{B}WEB\\Philippians\\3:13-14{/I}{/B}{BR}{BR}13  Brothers, I don't regard myself as yet having taken hold, but one thing I do. Forgetting the things which are behind, and stretching forward to the things which are before,\r {BR}14  I press on toward the goal for the prize of the high calling of God in Christ Jesus.\r {BR}{BR}"},{id:"150",scripture:"1 Timothy\\2:2",analysis:"Positive Spiritual Qualities",title:"Endurance",verses:"{I}{B}WEB\\1 Timothy\\2:2{/I}{/B}{BR}{BR}2  for kings and all who are in high places; that we may lead a tranquil and quiet life in all godliness and reverence.\r {BR}{BR}"},{id:"151",scripture:"2 Corinthians\\5:7",analysis:"Positive Spiritual Qualities",title:"Faith",verses:"{I}{B}WEB\\2 Corinthians\\5:7{/I}{/B}{BR}{BR}7  for we walk by faith, not by sight.\r {BR}{BR}"},{id:"152",scripture:"Luke\\19:17",analysis:"Positive Spiritual Qualities",title:"Faithfulness",verses:"{I}{B}WEB\\Luke\\19:17{/I}{/B}{BR}{BR}17  {I}{B}He said to him, 'Well done, you good servant! Because you were found faithful with very little, you shall have authority over ten cities.'{/B}{/I}\r {BR}{BR}"},{id:"153",scripture:"Isaiah\\12:2",analysis:"Positive Spiritual Qualities",title:"Fearlessness",verses:"{I}{B}WEB\\Isaiah\\12:2{/I}{/B}{BR}{BR}2  Behold, God is my salvation. I will trust, and will not be afraid; for Yah, Yahweh, is my strength and song; and he has become my salvation.\r {BR}{BR}"},{id:"154",scripture:"Titus\\2:10",analysis:"Positive Spiritual Qualities",title:"Fidelity",verses:"{I}{B}WEB\\Titus\\2:10{/I}{/B}{BR}{BR}10  not stealing, but showing all good fidelity; that they may adorn the doctrine of God, our Savior, in all things.\r {BR}{BR}"},{id:"155",scripture:"1 Corinthians\\15:7",analysis:"Positive Spiritual Qualities",title:"Forbearance",verses:"{I}{B}WEB\\1 Corinthians\\15:7{/I}{/B}{BR}{BR}7  Then he appeared to James, then to all the apostles,\r {BR}{BR}"},{id:"156",scripture:"Ephesians\\4:32",analysis:"Positive Spiritual Qualities",title:"Forgiveness",verses:"{I}{B}WEB\\Ephesians\\4:32{/I}{/B}{BR}{BR}32  And be kind to one another, tenderhearted, forgiving each other, just as God also in Christ forgave you.\r {BR}{BR}"},{id:"157",scripture:"1 Corinthians\\15:58",analysis:"Positive Spiritual Qualities",title:"Fortitude",verses:"{I}{B}WEB\\1 Corinthians\\15:58{/I}{/B}{BR}{BR}58  Therefore, my beloved brothers, be steadfast, immovable, always abounding in the Lord's work, because you know that your labor is not in vain in the Lord.\r {BR}{BR}"},{id:"158",scripture:"Proverbs\\18:24",analysis:"Positive Spiritual Qualities",title:"Friendship",verses:"{I}{B}WEB\\Proverbs\\18:24{/I}{/B}{BR}{BR}24  A man of many companions may be ruined, but there is a friend who sticks closer than a brother.\r {BR}{BR}"},{id:"159",scripture:"John\\15:2-8",analysis:"Positive Spiritual Qualities",title:"Fruitfulness",verses:"{I}{B}WEB\\John\\15:2-8{/I}{/B}{BR}{BR}2  {I}{B}Every branch in me that doesn't bear fruit, he takes away. Every branch that bears fruit, he prunes, that it may bear more fruit.{/B}{/I}\r {BR}3  {I}{B}You are already pruned clean because of the word which I have spoken to you.{/B}{/I}\r {BR}4  {I}{B}Remain in me, and I in you. As the branch can't bear fruit by itself, unless it remains in the vine, so neither can you, unless you remain in me.{/B}{/I}\r {BR}5  {I}{B}I am the vine. You are the branches. He who remains in me, and I in him, the same bears much fruit, for apart from me you can do nothing.{/B}{/I}\r {BR}6  {I}{B}If a man doesn't remain in me, he is thrown out as a branch, and is withered; and they gather them, throw them into the fire, and they are burned.{/B}{/I}\r {BR}7  {I}{B}If you remain in me, and my words remain in you, you will ask whatever you desire, and it will be done for you.{/B}{/I}\r {BR}8  {I}{B}In this is my Father glorified, that you bear much fruit; and so you will be my disciples.{/B}{/I}\r {BR}{BR}"},{id:"160",scripture:"Luke\\6:38",analysis:"Positive Spiritual Qualities",title:"Generosity",verses:"{I}{B}WEB\\Luke\\6:38{/I}{/B}{BR}{BR}38  {I}{B}Give, and it will be given to you: good measure, pressed down, shaken together, and running over, will be given to you. For with the same measure you measure it will be measured back to you.{/B}{/I}\r {BR}{BR}"},{id:"161",scripture:"Galatians\\5:22",analysis:"Positive Spiritual Qualities",title:"Gentleness",verses:"{I}{B}WEB\\Galatians\\5:22{/I}{/B}{BR}{BR}22  But the fruit of the Spirit is love, joy, peace, patience, kindness, goodness, faith,\r {BR}{BR}"},{id:"162",scripture:"Acts\\20:35",analysis:"Positive Spiritual Qualities",title:"Giving",verses:"{I}{B}WEB\\Acts\\20:35{/I}{/B}{BR}{BR}35  In all things I gave you an example, that so laboring you ought to help the weak, and to remember the words of the Lord Jesus, that he himself said, {I}{B}'It is more blessed to give than to receive.'{/B}{/I} \r {BR}{BR}"},{id:"163",scripture:"1 Timothy\\4:7",analysis:"Positive Spiritual Qualities",title:"Goldines",verses:"{I}{B}WEB\\1 Timothy\\4:7{/I}{/B}{BR}{BR}7  But refuse profane and old wives' fables. Exercise yourself toward godliness.\r {BR}{BR}"},{id:"164",scripture:"Matthew\\7:12",analysis:"Positive Spiritual Qualities",title:"Golden rule",verses:"{I}{B}WEB\\Matthew\\7:12{/I}{/B}{BR}{BR}12  {I}{B}Therefore whatever you desire for men to do to you, you shall also do to them; for this is the law and the prophets.{/B}{/I}\r {BR}{BR}"},{id:"165",scripture:"Luke\\23:50",analysis:"Positive Spiritual Qualities",title:"Good",verses:"{I}{B}WEB\\Luke\\23:50{/I}{/B}{BR}{BR}50  Behold, a man named Joseph, who was a member of the council, a good and righteous man\r {BR}{BR}"},{id:"166",scripture:"Luke\\6:25-27",analysis:"Positive Spiritual Qualities",title:"Good for evil",verses:"{I}{B}WEB\\Luke\\6:25-27{/I}{/B}{BR}{BR}25  {I}{B}Woe to you, you who are full now, for you will be hungry. Woe to you who laugh now, for you will mourn and weep.{/B}{/I}\r {BR}26  {I}{B}Woe, when men speak well of you, for their fathers did the same thing to the false prophets.{/B}{/I}\r {BR}27  {I}{B}But I tell you who hear: love your enemies, do good to those who hate you,{/B}{/I}\r {BR}{BR}"},{id:"167",scripture:"Colossians\\2:7",analysis:"Positive Spiritual Qualities",title:"Gratitude",verses:"{I}{B}WEB\\Colossians\\2:7{/I}{/B}{BR}{BR}7  rooted and built up in him, and established in the faith, even as you were taught, abounding in it in thanksgiving.\r {BR}{BR}"},{id:"168",scripture:"2 Peter\\1:5-6",analysis:"Positive Spiritual Qualities",title:"Growth",verses:"{I}{B}WEB\\2 Peter\\1:5-6{/I}{/B}{BR}{BR}5  Yes, and for this very cause adding on your part all diligence, in your faith supply moral excellence; and in moral excellence, knowledge;\r {BR}6  and in knowledge, self-control; and in self-control patience; and in patience godliness;\r {BR}{BR}"},{id:"169",scripture:"Leviticus\\19:2",analysis:"Positive Spiritual Qualities",title:"Holiness",verses:"{I}{B}WEB\\Leviticus\\19:2{/I}{/B}{BR}{BR}2  Speak to all the congregation of the children of Israel, and tell them, 'You shall be holy; for I Yahweh your God am holy.\r {BR}{BR}"},{id:"170",scripture:"Romans\\5:5",analysis:"Positive Spiritual Qualities",title:"Hope",verses:"{I}{B}WEB\\Romans\\5:5{/I}{/B}{BR}{BR}5  and hope doesn't disappoint us, because God's love has been poured out into our hearts through the Holy Spirit who was given to us.\r {BR}{BR}"},{id:"171",scripture:"Romans\\5:10",analysis:"Positive Spiritual Qualities",title:"Hospitality",verses:"{I}{B}WEB\\Romans\\5:10{/I}{/B}{BR}{BR}10  For if, while we were enemies, we were reconciled to God through the death of his Son, much more, being reconciled, we will be saved by his life.\r {BR}{BR}"},{id:"172",scripture:"1 Peter\\5:5",analysis:"Positive Spiritual Qualities",title:"Humility",verses:"{I}{B}WEB\\1 Peter\\5:5{/I}{/B}{BR}{BR}5  Likewise, you younger ones, be subject to the elder. Yes, all of you gird yourselves with humility, to subject yourselves to one another; for God resists the proud, but gives grace to the humble.\r {BR}{BR}"},{id:"173",scripture:"2 Peter\\3:9",analysis:"Positive Spiritual Qualities",title:"Longsufferng",verses:"{I}{B}WEB\\2 Peter\\3:9{/I}{/B}{BR}{BR}9  The Lord is not slow concerning his promise, as some count slowness; but is patient with us, not wishing that any should perish, but that all should come to repentance.\r {BR}{BR}"},{id:"174",scripture:"Galatians\\5:22",analysis:"Positive Spiritual Qualities",title:"Meekness",verses:"{I}{B}WEB\\Galatians\\5:22{/I}{/B}{BR}{BR}22  But the fruit of the Spirit is love, joy, peace, patience, kindness, goodness, faith,\r {BR}{BR}"},{id:"175",scripture:"Proverbs\\11:17",analysis:"Positive Spiritual Qualities",title:"Merciful",verses:"{I}{B}WEB\\Proverbs\\11:17{/I}{/B}{BR}{BR}17  The merciful man does good to his own soul, but he who is cruel troubles his own flesh.\r {BR}{BR}"},{id:"176",scripture:"Leviticus\\19:18",analysis:"Positive Spiritual Qualities",title:"Neighborhness",verses:"{I}{B}WEB\\Leviticus\\19:18{/I}{/B}{BR}{BR}18   'You shall not take vengeance, nor bear any grudge against the children of your people; but you shall love your neighbor as yourself. I am Yahweh.\r {BR}{BR}"},{id:"177",scripture:"Matthew\\5:19",analysis:"Positive Spiritual Qualities",title:"Peacemaker",verses:"{I}{B}WEB\\Matthew\\5:19{/I}{/B}{BR}{BR}19  {I}{B}Whoever, therefore, shall break one of these least commandments, and teach others to do so, shall be called least in the Kingdom of Heaven; but whoever shall do and teach them shall be called great in the Kingdom of Heaven.{/B}{/I}\r {BR}{BR}"},{id:"178",scripture:"John\\1:47",analysis:"Positive Spiritual Qualities",title:"Piety",verses:"{I}{B}WEB\\John\\1:47{/I}{/B}{BR}{BR}47  Jesus saw Nathanael coming to him, and said about him, {I}{B}Behold, an Israelite indeed, in whom is no deceit!{/B}{/I}\r {BR}{BR}"},{id:"179",scripture:"Job\\1:21",analysis:"Positive Spiritual Qualities",title:"Resignation",verses:"{I}{B}WEB\\Job\\1:21{/I}{/B}{BR}{BR}21  He said, Naked I came out of my mother's womb, and naked shall I return there. Yahweh gave, and Yahweh has taken away. Blessed be the name of Yahweh.\r {BR}{BR}"},{id:"180",scripture:"Ephesians\\6:14",analysis:"Positive Spiritual Qualities",title:"Righteousness",verses:"{I}{B}WEB\\Ephesians\\6:14{/I}{/B}{BR}{BR}14  Stand therefore, having the utility belt of truth buckled around your waist, and having put on the breastplate of righteousness,\r {BR}{BR}"},{id:"181",scripture:"Matthew\\16:24",analysis:"Positive Spiritual Qualities",title:"Self-denial",verses:"{I}{B}WEB\\Matthew\\16:24{/I}{/B}{BR}{BR}24  Then Jesus said to his disciples, {I}{B}If anyone desires to come after me, let him deny himself, and take up his cross, and follow me.{/B}{/I}\r {BR}{BR}"},{id:"182",scripture:"Hebrews\\12:1-2",analysis:"Positive Spiritual Qualities",title:"Steadfastness",verses:"{I}{B}WEB\\Hebrews\\12:1-2{/I}{/B}{BR}{BR}1  Therefore let us also, seeing we are surrounded by so great a cloud of witnesses, lay aside every weight and the sin which so easily entangles us, and let us run with patience the race that is set before us,\r {BR}2  looking to Jesus, the author and perfecter of faith, who for the joy that was set before him endured the cross, despising its shame, and has sat down at the right hand of the throne of God.\r {BR}{BR}"},{id:"183",scripture:"Proverbs\\4:27",analysis:"Positive Spiritual Qualities",title:"Straightforwardness",verses:"{I}{B}WEB\\Proverbs\\4:27{/I}{/B}{BR}{BR}27  Don't turn to the right hand nor to the left. Remove your foot from evil.\r {BR}{BR}"},{id:"184",scripture:"James\\4:7",analysis:"Positive Spiritual Qualities",title:"Submissiveness",verses:"{I}{B}WEB\\James\\4:7{/I}{/B}{BR}{BR}7  Be subject therefore to God. But resist the devil, and he will flee from you.\r {BR}{BR}"},{id:"185",scripture:"Luke\\9:49-50",analysis:"Positive Spiritual Qualities",title:"Tolerance",verses:"{I}{B}WEB\\Luke\\9:49-50{/I}{/B}{BR}{BR}49  John answered, Master, we saw someone casting out demons in your name, and we forbade him, because he doesn't follow with us.\r {BR}50  Jesus said to him, {I}{B}Don't forbid him, for he who is not against us is for us.{/B}{/I}\r {BR}{BR}"},{id:"186",scripture:"Hebrews\\11:24-25",analysis:"Positive Spiritual Qualities",title:"Unworldliness",verses:"{I}{B}WEB\\Hebrews\\11:24-25{/I}{/B}{BR}{BR}24  By faith, Moses, when he had grown up, refused to be called the son of Pharaoh's daughter,\r {BR}25  choosing rather to share ill treatment with God's people, than to enjoy the pleasures of sin for a time;\r {BR}{BR}"},{id:"187",scripture:"1 Thessalonians\\5:5-6",analysis:"Positive Spiritual Qualities",title:"Vigilance",verses:"{I}{B}WEB\\1 Thessalonians\\5:5-6{/I}{/B}{BR}{BR}5  You are all children of light, and children of the day. We don't belong to the night, nor to darkness,\r {BR}6  so then let's not sleep, as the rest do, but let's watch and be sober.\r {BR}{BR}"},{id:"188",scripture:"Philippians\\4:8",analysis:"Positive Spiritual Qualities",title:"Virtue",verses:"{I}{B}WEB\\Philippians\\4:8{/I}{/B}{BR}{BR}8  Finally, brothers, whatever things are true, whatever things are honorable, whatever things are just, whatever things are pure, whatever things are lovely, whatever things are of good report; if there is any virtue, and if there is any praise, think about these things.\r {BR}{BR}"},{id:"189",scripture:"Ephesians\\5:14",analysis:"Positive Spiritual Qualities",title:"Wakefulness",verses:"{I}{B}WEB\\Ephesians\\5:14{/I}{/B}{BR}{BR}14  Therefore he says, Awake, you who sleep, and arise from the dead, and Christ will shine on you.\r {BR}{BR}"},{id:"190",scripture:"1 Corinthians\\14:12\\",analysis:"Positive Spiritual Qualities",title:"Zealousness",verses:"{I}{B}WEB\\1 Corinthians\\14:12\\{/I}{/B}{BR}{BR}12  So also you, since you are zealous for spiritual gifts, seek that you may abound to the building up of the assembly.\r {BR}{BR}"},{id:"191",scripture:"Isaiah\\66:3",analysis:"Negative Spiritual Qualities",title:"Loving evil",verses:"{I}{B}WEB\\Isaiah\\66:3{/I}{/B}{BR}{BR}3  He who kills an ox is as he who kills a man; he who sacrifices a lamb, as he who breaks a dog's neck; he who offers an offering, ({I}{B}as he who offers{/B}{/I}) pig's blood; he who burns frankincense, as he who blesses an idol. Yes, they have chosen their own ways, and their soul delights in their abominations:\r {BR}{BR}"},{id:"192",scripture:"Matthew\\15:8",analysis:"Negative Spiritual Qualities",title:"Estranged from Christ",verses:"{I}{B}WEB\\Matthew\\15:8{/I}{/B}{BR}{BR}8  {I}{B}'These people draw near to me with their mouth, and honor me with their lips; but their heart is far from me.{/B}{/I}\r {BR}{BR}"},{id:"193",scripture:"Philippians\\3:19",analysis:"Negative Spiritual Qualities",title:"Indulgence",verses:"{I}{B}WEB\\Philippians\\3:19{/I}{/B}{BR}{BR}19  whose end is destruction, whose god is the belly, and whose glory is in their shame, who think about earthly things.\r {BR}{BR}"},{id:"194",scripture:"1 Corinthians\\15:50",analysis:"Negative Spiritual Qualities",title:"Excluded from God",verses:"{I}{B}WEB\\1 Corinthians\\15:50{/I}{/B}{BR}{BR}50  Now I say this, brothers, that flesh and blood can't inherit the Kingdom of God; neither does corruption inherit incorruption.\r {BR}{BR}"},{id:"195",scripture:"Matthew\\14:31",analysis:"Negative Spiritual Qualities",title:"Doubt",verses:"{I}{B}WEB\\Matthew\\14:31{/I}{/B}{BR}{BR}31  Immediately Jesus stretched out his hand, took hold of him, and said to him, {I}{B}You of little faith, why did you doubt?{/B}{/I}\r {BR}{BR}"},{id:"196",scripture:"Proverbs\\21:13",analysis:"Negative Spiritual Qualities",title:"Parsimomousness",verses:"{I}{B}WEB\\Proverbs\\21:13{/I}{/B}{BR}{BR}13  Whoever stops his ears at the cry of the poor, he will also cry out, but shall not be heard.\r {BR}{BR}"},{id:"197",scripture:"Ecclesiastes\\5:13",analysis:"Negative Spiritual Qualities",title:"Miserliness",verses:"{I}{B}WEB\\Ecclesiastes\\5:13{/I}{/B}{BR}{BR}13  There is a grievous evil which I have seen under the sun: wealth kept by its owner to his harm.\r {BR}{BR}"},{id:"198",scripture:"Isaiah\\29:15",analysis:"Negative Spiritual Qualities",title:"Guiltiness",verses:"{I}{B}WEB\\Isaiah\\29:15{/I}{/B}{BR}{BR}15  Woe to those who deeply hide their counsel from Yahweh, and whose works are in the dark, and who say, Who sees us? and Who knows us?\r {BR}{BR}"},{id:"199",scripture:"1 John\\3:15",analysis:"Negative Spiritual Qualities",title:"Brotherly hatred",verses:"{I}{B}WEB\\1 John\\3:15{/I}{/B}{BR}{BR}15  Whoever hates his brother is a murderer, and you know that no murderer has eternal life remaining in him.\r {BR}{BR}"},{id:"200",scripture:"Romans\\1:24",analysis:"Negative Spiritual Qualities",title:"Lust",verses:"{I}{B}WEB\\Romans\\1:24{/I}{/B}{BR}{BR}24  Therefore God also gave them up in the lusts of their hearts to uncleanness, that their bodies should be dishonored among themselves,\r {BR}{BR}"},{id:"201",scripture:"Luke\\20:20-23",analysis:"Negative Spiritual Qualities",title:"Craftiness",verses:"{I}{B}WEB\\Luke\\20:20-23{/I}{/B}{BR}{BR}20  They watched him, and sent out spies, who pretended to be righteous, that they might trap him in something he said, so as to deliver him up to the power and authority of the governor.\r {BR}21  They asked him, Teacher, we know that you say and teach what is right, and aren't partial to anyone, but truly teach the way of God.\r {BR}22  Is it lawful for us to pay taxes to Caesar, or not?\r {BR}23  But he perceived their craftiness, and said to them, {I}{B}Why do you test me?{/B}{/I}\r {BR}{BR}"},{id:"202",scripture:"Matthew\\18:30",analysis:"Negative Spiritual Qualities",title:"Pitilessness",verses:"{I}{B}WEB\\Matthew\\18:30{/I}{/B}{BR}{BR}30  {I}{B}He would not, but went and cast him into prison, until he should pay back that which was due.{/B}{/I}\r {BR}{BR}"},{id:"203",scripture:"Proverbs\\28:13",analysis:"Negative Spiritual Qualities",title:"Concealment of sin",verses:"{I}{B}WEB\\Proverbs\\28:13{/I}{/B}{BR}{BR}13  He who conceals his sins doesn't prosper, but whoever confesses and renounces them finds mercy.\r {BR}{BR}"},{id:"204",scripture:"Ephesians\\4:4",analysis:"Negative Spiritual Qualities",title:"Instability",verses:"{I}{B}WEB\\Ephesians\\4:4{/I}{/B}{BR}{BR}4  There is one body, and one Spirit, even as you also were called in one hope of your calling;\r {BR}{BR}"},{id:"205",scripture:"Titus\\1:15",analysis:"Negative Spiritual Qualities",title:"Unscrupulousness",verses:"{I}{B}WEB\\Titus\\1:15{/I}{/B}{BR}{BR}15  To the pure, all things are pure; but to those who are defiled and unbelieving, nothing is pure; but both their mind and their conscience are defiled.\r {BR}{BR}"},{id:"206",scripture:"2 Kings\\10:31",analysis:"Negative Spiritual Qualities",title:"Halfheartedness",verses:"{I}{B}WEB\\2 Kings\\10:31{/I}{/B}{BR}{BR}31  But Jehu took no heed to walk in the law of Yahweh, the God of Israel, with all his heart: he didn't depart from the sins of Jeroboam, with which he made Israel to sin.\r {BR}{BR}"},{id:"207",scripture:"Proverbs\\29:25",analysis:"Negative Spiritual Qualities",title:"Fear",verses:"{I}{B}WEB\\Proverbs\\29:25{/I}{/B}{BR}{BR}25  The fear of man proves to be a snare, but whoever puts his trust in Yahweh is kept safe.\r {BR}{BR}"},{id:"208",scripture:"Proverbs\\19:15",analysis:"Negative Spiritual Qualities",title:"Slothfulness",verses:"{I}{B}WEB\\Proverbs\\19:15{/I}{/B}{BR}{BR}15  Slothfulness casts into a deep sleep. The idle soul shall suffer hunger.\r {BR}{BR}"},{id:"209",scripture:"Matthew\\22:5",analysis:"Negative Spiritual Qualities",title:"Uninterestedness",verses:"{I}{B}WEB\\Matthew\\22:5{/I}{/B}{BR}{BR}5  {I}{B}But they made light of it, and went their ways, one to his own farm, another to his merchandise,{/B}{/I}\r {BR}{BR}"},{id:"210",scripture:"Amos\\6:1",analysis:"Negative Spiritual Qualities",title:"Indifference",verses:"{I}{B}WEB\\Amos\\6:1{/I}{/B}{BR}{BR}1  Woe to those who are at ease in Zion, and to those who are secure on the mountain of Samaria, the notable men of the chief of the nations, to whom the house of Israel come!\r {BR}{BR}"},{id:"211",scripture:"John\\8:24",analysis:"Negative Spiritual Qualities",title:"Unbelief",verses:"{I}{B}WEB\\John\\8:24{/I}{/B}{BR}{BR}24  {I}{B}I said therefore to you that you will die in your sins; for unless you believe that I am he, you will die in your sins.{/B}{/I}\r {BR}{BR}"},{id:"212",scripture:"Matthew\\25:24-25",analysis:"Negative Spiritual Qualities",title:"Unfaithfulness",verses:"{I}{B}WEB\\Matthew\\25:24-25{/I}{/B}{BR}{BR}24  {I}{B}He also who had received the one talent came and said, 'Lord, I knew you that you are a hard man, reaping where you did not sow, and gathering where you did not scatter.{/B}{/I}\r {BR}25  {I}{B}I was afraid, and went away and hid your talent in the earth. Behold, you have what is yours.'{/B}{/I}\r {BR}{BR}"},{id:"213",scripture:"Deuteronomy\\20:8",analysis:"Negative Spiritual Qualities",title:"Faintheartedness",verses:"{I}{B}WEB\\Deuteronomy\\20:8{/I}{/B}{BR}{BR}8  The officers shall speak further to the people, and they shall say, What man is there who is fearful and fainthearted? let him go and return to his house, lest his brother's heart melt as his heart.\r {BR}{BR}"},{id:"214",scripture:"Luke\\12:47",analysis:"Negative Spiritual Qualities",title:"Neglectfulness",verses:"{I}{B}WEB\\Luke\\12:47{/I}{/B}{BR}{BR}47  {I}{B}That servant, who knew his lord's will, and didn't prepare, nor do what he wanted, will be beaten with many stripes,{/B}{/I}\r {BR}{BR}"},{id:"215",scripture:"Luke\\9:54",analysis:"Negative Spiritual Qualities",title:"Vindictiveness",verses:"{I}{B}WEB\\Luke\\9:54{/I}{/B}{BR}{BR}54  When his disciples, James and John, saw this, they said, Lord, do you want us to command fire to come down from the sky, and destroy them, just as Elijah did?\r {BR}{BR}"},{id:"216",scripture:"Esther\\9:5",analysis:"Negative Spiritual Qualities",title:"Retaliation",verses:"{I}{B}WEB\\Esther\\9:5{/I}{/B}{BR}{BR}5  The Jews struck all their enemies with the stroke of the sword, and with slaughter and destruction, and did what they wanted to those who hated them.\r {BR}{BR}"},{id:"217",scripture:"James\\1:6",analysis:"Negative Spiritual Qualities",title:"Faltering",verses:"{I}{B}WEB\\James\\1:6{/I}{/B}{BR}{BR}6  But let him ask in faith, without any doubting, for he who doubts is like a wave of the sea, driven by the wind and tossed.\r {BR}{BR}"},{id:"218",scripture:"James\\4:4",analysis:"Negative Spiritual Qualities",title:"Enmity",verses:"{I}{B}WEB\\James\\4:4{/I}{/B}{BR}{BR}4  You adulterers and adulteresses, don't you know that friendship with the world is enmity with God? Whoever therefore wants to be a friend of the world makes himself an enemy of God.\r {BR}{BR}"},{id:"219",scripture:"Matthew\\3:10",analysis:"Negative Spiritual Qualities",title:"Unfruitfulness",verses:"{I}{B}WEB\\Matthew\\3:10{/I}{/B}{BR}{BR}10  Even now the axe lies at the root of the trees. Therefore, every tree that doesn't bring forth good fruit is cut down, and cast into the fire.\r {BR}{BR}"},{id:"220",scripture:"Luke\\12:15",analysis:"Negative Spiritual Qualities",title:"Covetousness",verses:"{I}{B}WEB\\Luke\\12:15{/I}{/B}{BR}{BR}15  He said to them, {I}{B}Beware! Keep yourselves from covetousness, for a man's life doesn't consist of the abundance of the things which he possesses.{/B}{/I}\r {BR}{BR}"},{id:"221",scripture:"Matthew\\25:24",analysis:"Negative Spiritual Qualities",title:"Harshness",verses:"{I}{B}WEB\\Matthew\\25:24{/I}{/B}{BR}{BR}24  {I}{B}He also who had received the one talent came and said, 'Lord, I knew you that you are a hard man, reaping where you did not sow, and gathering where you did not scatter.{/B}{/I}\r {BR}{BR}"},{id:"222",scripture:"Malachi\\3:8",analysis:"Negative Spiritual Qualities",title:"Withholding",verses:"{I}{B}WEB\\Malachi\\3:8{/I}{/B}{BR}{BR}8  Will a man rob God? Yet you rob me! But you say, 'How have we robbed you?' In tithes and offerings.\r {BR}{BR}"},{id:"223",scripture:"2 Timothy\\2:16",analysis:"Negative Spiritual Qualities",title:"Ungodliness",verses:"{I}{B}WEB\\2 Timothy\\2:16{/I}{/B}{BR}{BR}16  But shun empty chatter, for they will proceed further in ungodliness,\r {BR}{BR}"},{id:"224",scripture:"Proverbs\\24:29",analysis:"Negative Spiritual Qualities",title:"Anti-golden rule",verses:"{I}{B}WEB\\Proverbs\\24:29{/I}{/B}{BR}{BR}29  Don't say, I will do to him as he has done to me; I will render to the man according to his work.\r {BR}{BR}"},{id:"225",scripture:"Luke\\6:45",analysis:"Negative Spiritual Qualities",title:"Evil",verses:"{I}{B}WEB\\Luke\\6:45{/I}{/B}{BR}{BR}45  {I}{B}The good man out of the good treasure of his heart brings out that which is good, and the evil man out of the evil treasure of his heart brings out that which is evil, for out of the abundance of the heart, his mouth speaks.{/B}{/I}\r {BR}{BR}"},{id:"226",scripture:"1 Peter\\3:9",analysis:"Negative Spiritual Qualities",title:"Revenge",verses:"{I}{B}WEB\\1 Peter\\3:9{/I}{/B}{BR}{BR}9  not rendering evil for evil, or reviling for reviling; but instead blessing; knowing that to this were you called, that you may inherit a blessing.\r {BR}{BR}"},{id:"227",scripture:"Romans\\1:21",analysis:"Negative Spiritual Qualities",title:"Unthankfulness",verses:"{I}{B}WEB\\Romans\\1:21{/I}{/B}{BR}{BR}21  Because, knowing God, they didn't glorify him as God, neither gave thanks, but became vain in their reasoning, and their senseless heart was darkened.\r {BR}{BR}"},{id:"228",scripture:"Luke\\8:13",analysis:"Negative Spiritual Qualities",title:"Backsliding",verses:"{I}{B}WEB\\Luke\\8:13{/I}{/B}{BR}{BR}13  {I}{B}Those on the rock are they who, when they hear, receive the word with joy; but these have no root, who believe for a while, then fall away in time of temptation.{/B}{/I}\r {BR}{BR}"},{id:"229",scripture:"Romans\\6:13-14",analysis:"Negative Spiritual Qualities",title:"Unholiness",verses:"{I}{B}WEB\\Romans\\6:13-14{/I}{/B}{BR}{BR}13  Neither present your members to sin as instruments of unrighteousness, but present yourselves to God, as alive from the dead, and your members as instruments of righteousness to God.\r {BR}14  For sin will not have dominion over you. For you are not under law, but under grace.\r {BR}{BR}"},{id:"230",scripture:"Ephesians\\2:12",analysis:"Negative Spiritual Qualities",title:"Hopelessness",verses:"{I}{B}WEB\\Ephesians\\2:12{/I}{/B}{BR}{BR}12  that you were at that time separate from Christ, alienated from the commonwealth of Israel, and strangers from the covenants of the promise, having no hope and without God in the world.\r {BR}{BR}"},{id:"231",scripture:"1 Samuel\\19:10",analysis:"Negative Spiritual Qualities",title:"Inhospitality",verses:"{I}{B}WEB\\1 Samuel\\19:10{/I}{/B}{BR}{BR}10  Saul sought to strike David even to the wall with the spear; but he slipped away out of Saul's presence, and he struck the spear into the wall: and David fled, and escaped that night.\r {BR}{BR}"},{id:"232",scripture:"Isaiah\\2:17",analysis:"Negative Spiritual Qualities",title:"Haughtiness",verses:"{I}{B}WEB\\Isaiah\\2:17{/I}{/B}{BR}{BR}17  The loftiness of man shall be bowed down, and the haughtiness of men shall be brought low; and Yahweh alone shall be exalted in that day.\r {BR}{BR}"},{id:"233",scripture:"Luke\\9:54",analysis:"Negative Spiritual Qualities",title:"Impatience",verses:"{I}{B}WEB\\Luke\\9:54{/I}{/B}{BR}{BR}54  When his disciples, James and John, saw this, they said, Lord, do you want us to command fire to come down from the sky, and destroy them, just as Elijah did?\r {BR}{BR}"},{id:"234",scripture:"Numbers\\20:10",analysis:"Negative Spiritual Qualities",title:"Irritableness",verses:"{I}{B}WEB\\Numbers\\20:10{/I}{/B}{BR}{BR}10  Moses and Aaron gathered the assembly together before the rock, and he said to them, Hear now, you rebels; shall we bring you water out of this rock for you?\r {BR}{BR}"},{id:"235",scripture:"Proverbs\\12:10",analysis:"Negative Spiritual Qualities",title:"Cruel",verses:"{I}{B}WEB\\Proverbs\\12:10{/I}{/B}{BR}{BR}10  A righteous man regards the life of his animal, but the tender mercies of the wicked are cruel.\r {BR}{BR}"},{id:"236",scripture:"Luke\\10:30-32",analysis:"Negative Spiritual Qualities",title:"Unneighborliness",verses:"{I}{B}WEB\\Luke\\10:30-32{/I}{/B}{BR}{BR}30  Jesus answered, {I}{B}A certain man was going down from Jerusalem to Jericho, and he fell among robbers, who both stripped him and beat him, and departed, leaving him half dead.{/B}{/I}\r {BR}31  {I}{B}By chance a certain priest was going down that way. When he saw him, he passed by on the other side.{/B}{/I}\r {BR}32  {I}{B}In the same way a Levite also, when he came to the place, and saw him, passed by on the other side.{/B}{/I}\r {BR}{BR}"},{id:"237",scripture:"Proverbs\\15:18",analysis:"Negative Spiritual Qualities",title:"Contentiousness",verses:"{I}{B}WEB\\Proverbs\\15:18{/I}{/B}{BR}{BR}18  A wrathful man stirs up contention, but one who is slow to anger appeases strife.\r {BR}{BR}"},{id:"238",scripture:"Job\\21:14",analysis:"Negative Spiritual Qualities",title:"Impiety",verses:"{I}{B}WEB\\Job\\21:14{/I}{/B}{BR}{BR}14  They tell God, 'Depart from us, for we don't want to know about your ways.\r {BR}{BR}"},{id:"239",scripture:"Deuteronomy\\1:43",analysis:"Negative Spiritual Qualities",title:"Self-willed",verses:"{I}{B}WEB\\Deuteronomy\\1:43{/I}{/B}{BR}{BR}43  So I spoke to you, and you didn't listen; but you rebelled against the commandment of Yahweh, and were presumptuous, and went up into the hill country.\r {BR}{BR}"},{id:"240",scripture:"2 Thessalonians\\2:10",analysis:"Negative Spiritual Qualities",title:"Unrighteousness",verses:"{I}{B}WEB\\2 Thessalonians\\2:10{/I}{/B}{BR}{BR}10  and with all deception of wickedness for those who are being lost, because they didn't receive the love of the truth, that they might be saved.\r {BR}{BR}"},{id:"241",scripture:"Isaiah\\29:8",analysis:"Negative Spiritual Qualities",title:"Self-indulgence",verses:"{I}{B}WEB\\Isaiah\\29:8{/I}{/B}{BR}{BR}8  It will be like when a hungry man dreams, and behold, he eats; but he awakes, and his hunger isn't satisfied; or like when a thirsty man dreams, and behold, he drinks; but he awakes, and behold, he is faint, and he is still thirsty. The multitude of all the nations that fight against Mount Zion will be like that.\r {BR}{BR}"},{id:"242",scripture:"Ephesians\\4:14",analysis:"Negative Spiritual Qualities",title:"Wavering",verses:"{I}{B}WEB\\Ephesians\\4:14{/I}{/B}{BR}{BR}14  that we may no longer be children, tossed back and forth and carried about with every wind of doctrine, by the trickery of men, in craftiness, after the wiles of error;\r {BR}{BR}"},{id:"243",scripture:"Proverbs\\2:15",analysis:"Negative Spiritual Qualities",title:"Crookedness",verses:"{I}{B}WEB\\Proverbs\\2:15{/I}{/B}{BR}{BR}15  who are crooked in their ways, and wayward in their paths:\r {BR}{BR}"},{id:"244",scripture:"Isaiah\\65:2-5",analysis:"Negative Spiritual Qualities",title:"Rebellion",verses:"{I}{B}WEB\\Isaiah\\65:2-5{/I}{/B}{BR}{BR}2  I have spread out my hands all the day to a rebellious people, who walk in a way that is not good, after their own thoughts;\r {BR}3  a people who provoke me to my face continually, sacrificing in gardens, and burning incense on bricks;\r {BR}4  who sit among the graves, and lodge in the secret places; who eat pig's flesh, and broth of abominable things is in their vessels;\r {BR}5  who say, Stand by yourself, don't come near to me, for I am holier than you. These are a smoke in my nose, a fire that burns all the day.\r {BR}{BR}"},{id:"245",scripture:"Mark\\9:38",analysis:"Negative Spiritual Qualities",title:"Intolerance",verses:"{I}{B}WEB\\Mark\\9:38{/I}{/B}{BR}{BR}38  John said to him, Teacher, we saw someone who doesn't follow us casting out demons in your name; and we forbade him, because he doesn't follow us.\r {BR}{BR}"},{id:"246",scripture:"Luke\\21:34",analysis:"Negative Spiritual Qualities",title:"Worldliness",verses:"{I}{B}WEB\\Luke\\21:34{/I}{/B}{BR}{BR}34  {I}{B}So be careful, or your hearts will be loaded down with carousing, drunkenness, and cares of this life, and that day will come on you suddenly.{/B}{/I}\r {BR}{BR}"},{id:"247",scripture:"1 Corinthians\\10:12",analysis:"Negative Spiritual Qualities",title:"Unwatchfulness",verses:"{I}{B}WEB\\1 Corinthians\\10:12{/I}{/B}{BR}{BR}12  Therefore let him who thinks he stands be careful that he doesn't fall.\r {BR}{BR}"},{id:"248",scripture:"Romans\\1:26",analysis:"Negative Spiritual Qualities",title:"Impurity",verses:"{I}{B}WEB\\Romans\\1:26{/I}{/B}{BR}{BR}26  For this reason, God gave them up to vile passions. For their women changed the natural function into that which is against nature.\r {BR}{BR}"},{id:"249",scripture:"Proverbs\\6:9-10",analysis:"Negative Spiritual Qualities",title:"Sluggishness",verses:"{I}{B}WEB\\Proverbs\\6:9-10{/I}{/B}{BR}{BR}9  How long will you sleep, sluggard? When will you arise out of your sleep?\r {BR}10  A little sleep, a little slumber, a little folding of the hands to sleep:\r {BR}{BR}"},{id:"250",scripture:"Acts\\24:26\\",analysis:"Negative Spiritual Qualities",title:"Procrastination",verses:"{I}{B}WEB\\Acts\\24:26\\{/I}{/B}{BR}{BR}26  Meanwhile, he also hoped that money would be given to him by Paul, that he might release him. Therefore also he sent for him more often, and talked with him.\r {BR}{BR}"},{id:"251",scripture:"1 Corinthians\\9:24-25",analysis:"Positive Physical Qualities",title:"Activity",verses:"{I}{B}WEB\\1 Corinthians\\9:24-25{/I}{/B}{BR}{BR}24  Don't you know that those who run in a race all run, but one receives the prize? Run like that, that you may win.\r {BR}25  Every man who strives in the games exercises self-control in all things. Now they do it to receive a corruptible crown, but we an incorruptible.\r {BR}{BR}"},{id:"252",scripture:"1 Timothy\\2:2",analysis:"Positive Physical Qualities",title:"Endurance",verses:"{I}{B}WEB\\1 Timothy\\2:2{/I}{/B}{BR}{BR}2  for kings and all who are in high places; that we may lead a tranquil and quiet life in all godliness and reverence.\r {BR}{BR}"},{id:"253",scripture:"1 Samuel\\16:12",analysis:"Positive Physical Qualities",title:"Gracefulness",verses:"{I}{B}WEB\\1 Samuel\\16:12{/I}{/B}{BR}{BR}12  He sent, and brought him in. Now he was ruddy, and withal of a beautiful face, and goodly to look on. Yahweh said, Arise, anoint him; for this is he.\r {BR}{BR}"},{id:"254",scripture:"3 John\\1:2",analysis:"Positive Physical Qualities",title:"Health",verses:"{I}{B}WEB\\3 John\\1:2{/I}{/B}{BR}{BR}2  Beloved, I pray that you may prosper in all things and be healthy, even as your soul prospers.\r {BR}{BR}"},{id:"255",scripture:"Acts\\20:22-24",analysis:"Positive Physical Qualities",title:"Heroism",verses:"{I}{B}WEB\\Acts\\20:22-24{/I}{/B}{BR}{BR}22  Now, behold, I go bound by the Spirit to Jerusalem, not knowing what will happen to me there;\r {BR}23  except that the Holy Spirit testifies in every city, saying that bonds and afflictions wait for me.\r {BR}24  But these things don't count; nor do I hold my life dear to myself, so that I may finish my race with joy, and the ministry which I received from the Lord Jesus, to fully testify to the Good News of the grace of God.\r {BR}{BR}"},{id:"256",scripture:"2 Timothy\\2:3\\",analysis:"Positive Physical Qualities",title:"Physical courage",verses:"{I}{B}WEB\\2 Timothy\\2:3\\{/I}{/B}{BR}{BR}3  You therefore must endure hardship, as a good soldier of Christ Jesus.\r {BR}{BR}"},{id:"257",scripture:"Proverbs\\6:6-11",analysis:"Negative Physical Qualities",title:"Indolence",verses:"{I}{B}WEB\\Proverbs\\6:6-11{/I}{/B}{BR}{BR}6  Go to the ant, you sluggard. Consider her ways, and be wise;\r {BR}7  which having no chief, overseer, or ruler,\r {BR}8  provides her bread in the summer, and gathers her food in the harvest.\r {BR}9  How long will you sleep, sluggard? When will you arise out of your sleep?\r {BR}10  A little sleep, a little slumber, a little folding of the hands to sleep:\r {BR}11  so your poverty will come as a robber, and your scarcity as an armed man.\r {BR}{BR}"},{id:"258",scripture:"1 Corinthians\\9:22",analysis:"Negative Physical Qualities",title:"Weakness",verses:"{I}{B}WEB\\1 Corinthians\\9:22{/I}{/B}{BR}{BR}22  To the weak I became as weak, that I might gain the weak. I have become all things to all men, that I may by all means save some.\r {BR}{BR}"},{id:"259",scripture:"Isaiah\\57:17",analysis:"Negative Physical Qualities",title:"Awkwardness",verses:"{I}{B}WEB\\Isaiah\\57:17{/I}{/B}{BR}{BR}17  For the iniquity of his covetousness was I angry, and struck him; I hid ({I}{B}my face{/B}{/I}) and was angry; and he went on backsliding in the way of his heart.\r {BR}{BR}"},{id:"260",scripture:"Isaiah\\38:9",analysis:"Negative Physical Qualities",title:"Sickness",verses:"{I}{B}WEB\\Isaiah\\38:9{/I}{/B}{BR}{BR}9  The writing of Hezekiah king of Judah, when he had been sick, and had recovered of his sickness.\r {BR}{BR}"},{id:"261",scripture:"Psalms\\55:5",analysis:"Negative Physical Qualities",title:"Fearfulness",verses:"{I}{B}WEB\\Psalms\\55:5{/I}{/B}{BR}{BR}5  Fearfulness and trembling have come on me. Horror has overwhelmed me.\r {BR}{BR}"},{id:"262",scripture:"Hebrews\\13:6\\",analysis:"Negative Physical Qualities",title:"Physical fear",verses:"{I}{B}WEB\\Hebrews\\13:6\\{/I}{/B}{BR}{BR}6  So that with good courage we say, The Lord is my helper. I will not fear. What can man do to me?\r {BR}{BR}"}],tablename:"Analysis"};